// String returns the UTF string value of the Reaction (e.g. 👍).
func (r Reaction) String() string {
	return r.raw
}

// Shortcode returns the ASCII shortcode of the Reaction as it is usually
// accepted by chat adapters (e.g. "thumbsup").
func (r Reaction) Shortcode() string {
	return r.shortcode
}

